import React, { Component } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import iconShadow from 'leaflet/dist/images/marker-shadow.png';
import icon from 'leaflet/dist/images/marker-icon.png';
import L from 'leaflet';

export default class Map extends Component {
    render() {

        let Icon = L.icon({
            iconUrl: icon,
            shadowUrl: iconShadow
        });

        const lat = this.props
        const lng = this.props

        const posi = [this.props.lat, this.props.lng]

        const poss = posi
        const position = [-41.459371, -72.959090]


        const { zoom } = this.props
        const { popup } = this.props

        console.log("LAT: "+ this.props.lat)
        console.log("LNG: "+ this.props.lng)
        console.log(position)
        console.log(posi)
        console.log(poss)

        return (
            <>

                {this.props.prop.map((item) => {
                    return (
                        <div key={item.id}>
                            <MapContainer
                                className="map"
                                center={item.coordenadasP}
                                zoom={zoom}
                                style={{ height: this.props.height }}
                            >
                                <TileLayer
                                    attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                                />
                                <Marker position={item.coordenadasP} icon={Icon} >
                                    <Popup>
                                        {popup}
                                    </Popup>
                                </Marker>
                            </MapContainer>
                        </div>
                    )
                })}

            </>
        );
    }
}
